import React, { Component } from "react";
import axious from "axios";
class EditTodo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      todo_description: "",
      todo_responsible: "",
      todo_prioroty: "",
      todo_completed: false
    };
  }
  render() {
    return (
      <div>
        <h2>Welcome to Edit List Component.</h2>
      </div>
    );
  }
}
export default EditTodo;
